import './App.css';
import Post from './Post.js';
import { posts } from './data.js'
import { useEffect, useState } from 'react';
import Axios from 'axios'


function App() {
  return (
    <div className="App">
      <ShowFetch/>
     <Feed/>
    </div>
  );
}

function Feed() {
  return (
  <Post post={posts[0]}/>
  )
}

function ShowFetch() {
  const [ posts, setPosts ] = useState('')

  useEffect(() => {
    getPosts();
  }, [])

  const getPosts = () => {
      Axios.get('http://localhost:3001/api')
      .then((response) => {
        const allPosts = response.data
        setPosts(allPosts)
    })
      .catch(error => console.error('Error: ' + error))  
  }

  // console.log((posts[0]))

  if (posts.length > 0) {
  return (
    <div>
      {posts.map((post, i) => {
        <li key={i}>
        </li>
      })}
    </div> 
  )}
}




export default App;
